import React, {Component} from 'react';
import {Container, Form} from "react-bootstrap";
import SubTitle from "../SubTitle/SubTitle";
import SimpleText from "../SimpleText/SimpleText";
import './HowToContact.css'
function HowToContact(props) {
    const simpleTextStyle={
        padding: '0 0 0 0',

    };
    const howToContactRightText={
        firstEction:'У верхньому меню натиснути на події'
    }
        return (
            <div>
                <div className="how-to-contact-container">
                    <div className="how-to-contact-left">
                   <SubTitle text="Для запису на індивідуальні консультації вам потрібно:"/>
                        <SimpleText style={simpleTextStyle} text="Звязатись зі мною за телефоном +380 50 375 45 76"/>
                        <SimpleText style={simpleTextStyle} text="Домовитись про зручну для вас дату та час"/>
                    </div>
                    <div className="how-to-contact-right">
                   <SubTitle text="Для запису на групові заняття потрібно:"/>
                    <SimpleText style={simpleTextStyle} text={howToContactRightText.firstEction}/>
                    <SimpleText style={simpleTextStyle} text="Обрати групове заняття яке вас цікавить"/>
                    <SimpleText style={simpleTextStyle} text="Заповнити форму зворотнього зв'язку і наш менеджер зателефонує вам"/>
                    </div>
                </div>
            </div>
        );

}

export default HowToContact;
